class Table extends Component {
   constructor(props){
    super(props)
    this.state = {
      showFunc : props.showFunc,
      showing : props.showing
    }
   }


   render() {

     return (
      <div className="">
        <p>NESTO!</p>
      </div>
     )
   }
}

export default Table;
